    return(

        <Row>
            {libri.map((libro) => {
                return(
                    <Col key={libro.asin} sm={6} md={4} lg={3} xl={3}>
                        <SingleBook libro={libro}/> 
                    </Col>
                );
            })}
        </Row>


    );
}


export default FantasyBooks;
